import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {nome: ''};
    this.state = {rga: ''};
  }

  render() {    
    return (
      <div className="App"> 
        <h2>Cadastro</h2>
        <hr />

        <label>Nome: </label>
        <input type="text" />
        <br />

        <label>RGA: </label>
        <input type="text"/>
        <br />

        <input type="button" value="Submit" />

          <hr />      
      </div>
    );
  }

}

export default App;
